import React from "react";
import "./Form.css";

const Form = () => {
  return ( <
    div >
    <
    h2 > Generate your own meme! < /h2> <
    button className = "secondary-btn" > Go Back! < /button> <
    button className = "primary-btn" > Generate < /button> <
    /div>
  )
};

export default Form;
